    return (
        <>
            <h3 className="App-title">Los Gifs mas populares</h3>
            <ul>
            {POPULAR_GIFS.map((popularGif) => (
                <li key={popularGif}>
                    <Link to={`/search/${popularGif}`}>Gifs de
                    {popularGif}</Link>
                </li>
            ))}
            </ul>
        </>
    )
}

export default index
